import React from 'react';

const TweetsList = ({tweet}) => ( 
    <>
    <div className="grid-container2">
        {tweet.map((tweet, key) => (
            <>
            <div className="tweet" key={key}>
                <p>{tweet.text}</p>
            </div> 
            {tweet.user.map((user, key) => (
                <div key={key}> 
                <h4>{user.name} {user.screen_name} <img src={user.profile_image_url} alt="cannot display" /></h4>
                <p>{user.location}</p>
                </div>
            ))}
            </>
        ))}
    </div>
    </>
)

export default TweetsList;
